(790, 105, 105, '2018-05-15 03:04:24', '2018-05-15 03:04:24', 'n/a', 0, 0, 0, NULL, 'Disaster Recovery Technician Certification', 0, 0, 1, 25, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 3764, 'Operation Safe Houston\r\n\r\nHAUL worked tirelessly following Hurricane Harvey to assess and meet the needs of those who were affected by providing services through HAUL Operation SAFE Houston. With the help of our many supporters, including Delivering Good and The Hurricane Harvey Relief Fund, we distributed new products, including apparel, accessories, shoes, home furnishings, furniture, books, school supplies and other items allowing families to obtain resources they needed and begin the recovery process.  HAUL provided long-term disaster housing counseling and case management services delivered through co-location with the City of Houston at Kashmere and Acres Homes Multi Service Centers. Program services are dedicated to flood recovery services of counseling regarding FEMA application, documentation of loss, SBA application and Appeal, homeowners insurance claims, home inspection process, home repair information/assistance, fair housing rights, disaster recovery information. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 124, 613),
