(38723, 105, 105, '2019-05-17 02:17:26', '2019-05-17 02:17:26', 'n/a', 0, 0, 0, NULL, 'Harvey Disaster Recovery/Operation Safe Houston', 0, 0, 1, 3699, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 3699, 'The Houston Area Urban League (HAUL) partnering with Delivering Good, Inc., implemented Operation SAFE Houston to distribute emergency financial assistance and new products, including furniture, home furnishings, men\'s and women\'s apparel, accessories, shoes, toys, books, school supplies and other items to affected families. HAUL established “Pop-up Shops” as distribution sites for Houstonians and local organizations to help families recover from the devastating effects of Hurricane Harvey and its aftermath.\r\n\r\nHAUL Housing Counselors and staff conducted outreach and case management to clients providing information and resources to support post storm conditions and develop needs assessments. Program staff co-located at City of Houston recovery sites providing direct services dedicated to flood recovery services of counseling regarding FEMA application, documentation of loss, SBA application and Appeal, homeowners insurance claims, home inspection process, home repair information/assistance, fair housing rights, disaster recovery information. These services included workforce development/skills training to address Harvey related job loss and resource distribution and functioned as a part of HAUL’s Operation Safe Houston Hurricane Relief initiative. \r\n\r\nWorkforce Development staff worked closely with our Housing Counselors to address the diverse and special employment needs of our clients. HAUL fulfilled Workforce Development and Training objectives providing a menu of services to include: NCCER Construction Training, Job Readiness, Career/Financial Coaching and Supportive Services. HAUL provided training specialization as Disaster Restoration\r\nWorkers consisting of restoring the components of structures back to pre-hurricane condition. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 119, 38279),
(38726, 1194, 1194, '2019-05-17 02:35:14', '2019-05-17 02:35:14', 'n/a', 0, 0, 0, NULL, 'Job Fair', 0, 0, 1, 150, 'Food Giveaway', 0, 0, 1, 5000, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 5000, 'In the wake of Hurricane Irma, the Urban League of Broward County launched Restore 954 - a community initiative designed to address the immediate and ongoing needs of families impacted by the storm. The Urban League held a food truck festival providing 5000 free meals to families in need, distributed 1150 food boxes, hygiene kits and t-shirts, established the Family First Fund to provide emergency relief, and acted as a FEMA application site for those seeking assistance from the federal government. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 124, 37834),
