(39072, 1630, 1630, '2019-05-21 00:10:51', '2019-05-21 00:10:51', 'CUL offered tutorial programs to students in the Marion County Level Up program.', 0, 0, 1, 35, 'CUL provided career education and employment readiness programs to students in Marion County through the Level Up Program and JAG', 0, 0, 1, 50, 'CUL partnered with the Marion County Coordinating Council to disperse health education resources to the citizens of Marion and to collectively assess the needs of the community.', 0, 0, 1, 200, 'CUL facilitated community service projects throughout the year to the homeless shelter and elderly population', 0, 0, 1, 135, 'n/a', 0, 0, 0, NULL, 420, 'The Pee Dee Community Action Partnership offer Head Start and Early Head Start services to help over 900 children became school ready every year. Only 48% of 5-year-olds from low-income families are school ready.\r\n\r\nPDCAP also offers The Strengthening Families Program (SFP) which fits the needs of our community because it provides a powerful tool to increase collaboration among agencies, engage parent leaders more consistently and link state and community resources more effectively. \r\n\r\nThe SFP helps to benefit all families because the program: builds on family strengths, buffers risk, and promotes better outcomes: builds on and can be integrated into existing PDCAP and community programs, strategies, systems, and community opportunities; is implemented through small but significant changes in everyday action that is grounded in research practice and implementation knowledge. There is no doubt the SFP aligns with addressing the need of the targeted population of Marion County.\r\n\r\nPee Dee Community Action also puts people on a path to good jobs through employment support every year. In any given year, more than 7,000 families participate in PDCAP Community Action programs.  Each year, several hundred parents improve family functioning skills and thousands more children experience improved health and physical development with the help of Community Action Agencies. Many of our families live in economically distressed areas. That’s why PDCAP facilitate community initiatives to develop healthy communities that offer economic opportunity and actively engage people with low incomes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 119, 37961),
