(41321, 1688, 1688, '2020-06-09 04:04:20', '2020-06-09 04:04:20', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, NULL, 'The Winston-Salem Urban League has been provided funding for COVID-19 employment relief and support. We will provide additional support to local residents in finding and obtaining employment in the COVID-19 economy. Additionally, the WSUL has founded the Triad Food & Beverage Coalition to support local restaurateurs and service-industry workers in advocacy efforts and economic development activities. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 119, 40431),
(41340, 105, 105, '2020-06-09 05:21:30', '2020-06-09 05:21:30', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 2500, 'HAUL was contracted for the ICF Disaster Relief Program dedicated to flood recovery services of case management regarding City of Houston application and documentation of loss. Services included Resource Navigation regarding homeowner’s insurance claims, home inspection process, home repair assistance and fair housing rights.\r\n\r\nHAUL staff served as multi-lingual housing advisors in the Disaster Recovery Housing Resource Centers and Mobile Units where these services were required throughout the survey, intake, and case management processes. HAUL assisted with creating targeted messaging for hard-to-reach populations including low-to-moderate income, elderly, disabled, and non-English speaking populations. Staff implemented the outreach plan to build awareness among vulnerable populations and potential program applicants which included canvassing Census tracts that required direct door-to-door or other intensive outreach to reach vulnerable populations and supported informational workshops and community-based events as requested.\r\n\r\nHAUL also provided information and referrals to additional support services not included nor provided as part of the City’s Housing programs to applicants needing additional non-housing related services (e.g. physical or behavioral health, substance abuse, foreclosure prevention, etc.) and to the extent feasible, efforts will be made to link these applicants to additional supportive services.\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 119, 41168),
