(43526, 105, 105, '2021-07-13 05:52:21', '2021-07-13 05:52:21', 'n/a', 1, 1, 1, 398, 'n/a', 1, 1, 1, 1324, 'n/a', 1, 1, 1, NULL, 'n/a', 1, 1, 1, 4275, 'n/a', 1, 1, 1, NULL, 5997, 'HAUL provided COVID services of Counseling regarding basic needs, fair housing rights, resource navigation accessing rental assistance and unemployment benefits, disaster preparedness and case management. Services were specific to assessing individual/family needs helping them develop a recovery plan and providing access to resources for their unmet needs to fill serious service gaps that impacted communities.\r\n\r\nHAUL provided Flexible Emergency Financial Assistance, Financial/Housing Counseling, Housing and homeless prevention solutions and System Response Coordination. Services include activities to address business disruption, job loss and resource distribution. Assessments for small/microbusiness owners who could not access the Paycheck Protection Program and were unable to access pandemic unemployment insurance benefits included assistance with documentation of loss and delinquency notices. The process coordinated with the SBA Program for\r\nInvestment in Microentrepreneurs providing training and technical assistance to disadvantaged entrepreneurs.\r\n\r\nHAUL adapted programming to mitigate the spread of the virus while providing services by ensuring qualified staff with the right disaster response credentials and accurate information facilitate service delivery. HAUL transitioned to a remote web-based protocol for sessions, seminars, meetings, counseling, coaching and general services for all of our programs: Housing and Financial Literacy, Education and Family Support, Workforce Development and Training, Entrepreneurship/Small Business University and Advocacy.', NULL, NULL, NULL, NULL, NULL, 1, 283152, '2020-04-09', 1, 288737, '2021-04-10', '4', NULL, 1, 7388, 119, 43106),
