(43664, 1868, 1868, '2021-07-15 20:02:22', '2021-07-15 20:02:22', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'Household & Hygiene Distribution Program', 0, 0, 1, 4153, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 4153, 'At the onset of the COVID-19 pandemic, we assisted our community in distributing much-needed household & hygiene products that the community were unable to provide for their families to help battle the COVID-19 virus.  We provided cleaning products, toilet paper, paper towels, toothbrush, toothpaste, deodorant, trash bags, and dish washing liquid.', NULL, NULL, NULL, NULL, NULL, 1, 15602, '2020-05-18', 0, NULL, '2021-07-15', '4', NULL, 1, 250, 119, 42804),
