hout the year.GWUL serves clients who are working, low income, disconnected, in a time of difficulty, experiencing hardships, disabled, etc.  \r\nTotal Served:  609\r\nServices:  Financial Assistance A) Pepco (Electric) - Total Served 274; B) Washington Gas - Total Served 65; C) DC Water/SPLASH Program - Total Served 270\r\nFunding: A) PEPCO Private Foundation Grant $90,000 & B) DC Water Private Corporation Individual Giving $90,000\r\n79% Female 21% Male \r\n94% African American; 0.3% Asian, 3.4% Latinx, 2.3% Other\r\n', NULL, NULL, NULL, NULL, NULL, 1, NULL, '2021-08-27', NULL, NULL, '2021-08-27', '6', 0, 1, NULL, 119, 42353),
