(45511, 1247, 1247, '2022-05-04 17:41:34', '2022-05-04 17:41:34', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-04', NULL, NULL, '2022-05-04', NULL, NULL, NULL, NULL, 119, 44674),
(45573, 1978, 1978, '2022-05-05 01:52:08', '2022-05-05 01:52:08', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 1230, 'The Urban League of Middle TN is a member of The Nashville VOAD. Its mission is to promote cooperation, communication, coordination, and collaboration in an effort to foster more effective delivery of services to communities affected by a disaster. While we are most active in response and recovery, we participate in all four phases of disaster management.\r\n\r\n• Preparedness - planning, training, and educational activities performed to increase our capability to respond to a disaster\r\n• Mitigation - actions taken to prevent or reduce the cause, impact, and consequences of disasters\r\n• Response - activities that address the short-term, direct effects of an incident and include immediate actions to\r\nsave lives, protect property, and meet basic human needs\r\n• Recovery - long term activities that work towards restoring the community to pre-disaster norms or better \r\n\r\nThe Nashville VOAD is a member of the Tennessee Voluntary Organizations Active in Disaster. Membership with the Nashville VOAD identifies your organization as an integral partner of the community, supporting our work in response to disaster and helping with our communities’ recovery efforts.\r\n\r\nSome of our Goals:\r\n• Increase capacity to provide more efficient services to victims of disasters.\r\n• Better response to disasters through cooperation, communication, coordination, and collaboration.\r\n• Networking and sharing best practices with individuals and organizations active in disaster responses.\r\n• Reduce or eliminate the adverse effect of natural, technological, and human-caused hazards on our socio-economic and physical environments through preparedness, mitigation, and education.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-04', NULL, NULL, '2022-05-04', NULL, NULL, NULL, NULL, 119, 44694),
