(45764, 1156, 1156, '2022-05-07 02:00:06', '2022-05-07 02:00:06', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-06', NULL, NULL, '2022-05-06', NULL, NULL, NULL, NULL, 119, 44705),
(45781, 105, 105, '2022-05-07 03:55:34', '2022-05-07 03:55:34', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 599, 'The Houston Area Urban League\'s program is dedicated to COVID services with outreach to vulnerable populations and communities impacted by the virus. Prioritized clients including seniors, veterans and others will receive resource distribution and Counseling regarding basic needs, emergency financial assistance, financial/housing resource navigation for rental or mortgage assistance, unemployment benefits and case management. Services will be specific to assessing individual/family needs helping them develop a recovery plan and providing resources to low-income, minority, small/microbusiness owners under duress. HAUL provided Flexible Emergency Financial Assistance (mortgage/rent, utilities, food, medical, childcare, transportation, and other expenses related to basic needs) to qualified applicants as provided $1,200 for a household of 1-4 persons or $1,500 for a household of 5 or more persons.\r\n\r\nIn February 2021, a Texas Severe Weather Storm affected our region, causing millions of people in our region to lose electricity and water services. This severe weather caused widespread home damage that required immediate repairs in order to provide safe home conditions for vulnerable families and residents. Recognizing the dire hardships created by the extreme winter weather, Houston Mayor Sylvester Turner and Harris County Judge Lina Hidalgo established the Houston Harris County Winter Storm Relief Program to help our region\'s most vulnerable neighbors during this critical time of need. The Fund focused on relief and recovery efforts across the City of Houston and Harris County.\r\n\r\nHAUL assisted vulnerable low-income homeowners and renters in disproportionately impacted communities and unincorporated areas of Harris County with emergency financial assistance to support their recovery from the Winter Storm. Services included direct assistance for temporary housing, re-location, utilities, furniture and food replacement, lost wages, and/or other relief and recovery-related expenses. Program services have provided case management to facilitate long-term sustainability and helped clients to cope during uncertain times. Assistance to vulnerable low-income households, including renters and homeowners, with emergency Financial assistance to support their recovery from the Winter Storm with direct assistance payments of up to $1,000 per household for temporary housing, re-location, minimal home repair expenses, furniture and food replacement, lost wages, and/or other relief and recovery related expenses.\r\n\r\nImpacts of the Winter Storm – loss of income from job, food, rental utility assistance, increase in electric bill, survey completion, pipes busted, lights off for more than 3 days, no running water, ceiling collapse, landlord tenant issues, eviction issues, car damage.\r\n\r\nClient services included: Food, utility and rental assistance, landlord tenant issues, fair housing complaint, foreclosure issues, homeless services, medical access, medication needs, plumbing/pipes busted. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-06', NULL, NULL, '2022-05-06', NULL, NULL, NULL, NULL, 119, 44458),
