(46329, 1157, 1157, '2022-05-11 23:17:28', '2022-05-11 23:17:28', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 3467, 'The Urban League of Nebraska partnered with the Hy-Vee grocery store chain and the Douglas County Health & Human Services organization  to provide free COVID vaccines to the public this past year. Additionally the ULN partnered with several employer partners to receive and disseminate  COVID-related relief services, personal protective equipment, and preventative information.  Thanksgiving meals were again provide to the public (post pandemic)  via drive-thru services.  Locations to where individuals could safely get vaccinations and booster shots at no costs were disseminated to the community via social media, the ULN website, and the USPS system. ULN was also the recipient of two PPP loans , which allowed the ULN to continue to operate with full time compensation and benefits being paid to ALL ULN Staff without threat of layoffs or furlough. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-11', NULL, NULL, '2022-05-11', NULL, NULL, NULL, NULL, 119, 46234),
