(46577, 1327, 1327, '2022-06-01 03:07:17', '2022-06-01 03:07:17', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 1749, 'Five Rental and Utility Assistance Programs\r\n \r\n1) Emergency Rental Assistance Program\r\nThe Emergency Rental Assistance Program (ERAP) helps District residents earning less than 40% of the Area Median Income (AMI) who are facing housing emergencies, by providing funding for overdue rent including late fees and court costs and if you are facing eviction. \r\nTotal Served: 314  \r\nFunding:  DC Department of Human Services; Public State; Grant; $750,000\r\nServices: Financial Assistance\r\n89% African American; 0.5% Caucasian, 10% Latinx, 0.5% Caucasian\r\n\r\n\r\n2) Project Reconnect/ Rapid Exit \r\nEmergency financial assistance for persons experiencing homelessness.  \r\nTotal Served: 207  \r\nFunding:  DC Department of Human Services; Public State; Grant; $152,820\r\nServices: Financial Assistance\r\n26% Female 73% Male 1% Undisclosed\r\n76% African American; 9% Caucasian, 5% Latinx, 14% Other/Not Disclosed\r\n\r\n3) COVID Housing Assistance Program (CHAP) \r\nEmergency rental assistance for persons at risk of eviction due to direct impact of COVID.  \r\nTotal Served: 277 \r\nFunding: DC Department of Human Services; Public State; Grant; $1,672,905\r\nServices:  Financial Assistance\r\n64% Female 35% Male 1% Non-Binary\r\n75% African American; 1% Asian, 5% Caucasian, 10% Latinx, 8% Other\r\n\r\n4) Rapid Rehousing for Individuals\r\nRental subsidy to prevent or end homelessness   \r\nTotal Served: 342  \r\nFunding: DC Department of Human Services; Public State; Grant; $1,995,713\r\nServices:  Financial Assistance\r\n\r\n5) Utility Payment Assistance\r\nGreater Washington Urban League (GWUL) helps district residents who face utility emergencies that could lead to electric, gas and water disconnections. One-time, emergency utility assistance is provided to eligible residents throughout the year.GWUL serves clients who are working, low income, disconnected, in a time of difficulty, experiencing hardships, disabled, etc.  \r\nTotal Served:  609\r\nServices:  Financial Assistance A) Pepco (Electric) - Total Served 274; B) Washington Gas - Total Served 65; C) DC Water/SPLASH Program - Total Served 270\r\nFunding: A) PEPCO Private Foundation Grant $90,000 & B) DC Water Private Corporation Individual Giving $90,000\r\n79% Female 21% Male \r\n94% African American; 0.3% Asian, 3.4% Latinx, 2.3% Other\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-31', NULL, NULL, '2022-05-31', NULL, NULL, NULL, NULL, 119, 46549),
