(46671, 1743, 1743, '2022-07-15 05:26:32', '2022-07-15 05:26:32', 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, NULL, 'We provide staffing for cold weather shelters in conjunction with United Way of King County as requested. We assist with feeding, job readiness coaching, and provide referrals to other organizations when needed. Staff participates in the annual county Point-In-Time Count, known locally as \"Count Us In\" every January to collect data on King County\'s homeless population.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-14', NULL, NULL, '2022-07-14', NULL, NULL, NULL, NULL, 119, 44454),
