(46695, 1071, 1071, '2022-08-26 17:01:44', '2022-08-26 17:01:44', 'Provided education resources and information on COVID-19, Hurricane Ida relief efforts, School closures/distance learning and Broadband access and employment opportunities; Provided school supplies, coats and uniform vouchers. ', 0, 0, 1, 6600, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 'n/a', 0, 0, 0, NULL, 6751, 'In response to the impact of Hurricane Ida, the Urban League of Louisiana partnered with local and national partners to provide emergency relief items (food, water, roof tarps, diapers, baby formula, cleaning products, paper towels, toilet paper, etc) to residents in the 9th ward, an historically underserved community and an area previously devastated by Hurricane Katrina. \r\n\r\nThe Urban League of Louisiana\'s Black Business Works Fund provided $2,500 microgrants to 36 small businesses impacted by Hurricane Ida.\r\n\r\nThe Center for Entrepreneurship & Innovation supported 151 business owners in obtaining loans and grants related to COVID-19 and Hurricane Ida disaster recovery. Programs included:\r\n- SBA Economic Injury Disaster Loans and the Paycheck Protection Program – Assisted small businesses with applying for the SBA EIDL and the PPP; hosted several information sessions in collaboration with the SBA Louisiana District Office to increase awareness and to educate on eligibility and application processes for various SBA funding programs \r\n- Resilient Restart East Baton Rouge Parish – Small Business Micro-grants Program – Administered micro-grants program for small businesses impacted by COVID-19 operating and residing in East Baton Rouge Parish, Louisiana; $2,500 micro-grants awarded\r\n- Black Business Works Fund – Co-administered the Black Business Works Fund in collaboration with the Foundation for Louisiana to support Black-owned businesses for Hurricane Ida federally-declared disaster areas across Louisiana; $2,500 micro-grants awarded\r\n- NUL/Ford Emergency Capital Access Program – Administered micro-grants in the amount of $1,500 for Black-owned small businesses in New Orleans impacted by COVID-19. (National Urban League/Ford Foundation)\r\n- NUL/Regions Bank Small Business Micro-grants Program – Administered $2,500 micro-grants for minority-owned small businesses impacted by COVID-19 \r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-08-26', NULL, NULL, '2022-08-26', NULL, NULL, NULL, NULL, 119, 46687);
